import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Signup = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    fullName: '',
    email: '',
    password: '',
    confirmPassword: '',
    phone: '',
    address: '',
    city: '',
    state: '',
    zip: '',
    country: '',
    dob: '',
    gender: '',
    acceptedTerms: false,
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Simple validation example
    if (formData.password !== formData.confirmPassword) {
      alert("Password and Confirm Password don't match");
      return;
    }
    if (!formData.acceptedTerms) {
      alert("Please accept the terms and conditions");
      return;
    }

    // TODO: Backend call here to create user account
    console.log('User signed up:', formData);

    // Simulate login after signup
    localStorage.setItem('isLoggedIn', true);
    localStorage.setItem('userName', formData.fullName);

    navigate('/');  // Redirect to home or dashboard
  };

  return (
    <div className="max-w-md mx-auto p-6 border rounded shadow mt-8">
      <h2 className="text-2xl font-bold mb-4">Signup</h2>
      <form onSubmit={handleSubmit}>

        <label className="block mb-1">Full Name</label>
        <input
          name="fullName"
          value={formData.fullName}
          onChange={handleChange}
          required
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Email</label>
        <input
          name="email"
          type="email"
          value={formData.email}
          onChange={handleChange}
          required
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Password</label>
        <input
          name="password"
          type="password"
          value={formData.password}
          onChange={handleChange}
          required
          className="w-full mb-3 p-2 border rounded"
          minLength={6}
        />

        <label className="block mb-1">Confirm Password</label>
        <input
          name="confirmPassword"
          type="password"
          value={formData.confirmPassword}
          onChange={handleChange}
          required
          className="w-full mb-3 p-2 border rounded"
          minLength={6}
        />

        <label className="block mb-1">Phone Number</label>
        <input
          name="phone"
          type="tel"
          value={formData.phone}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
          placeholder="+92 300 1234567"
        />

        <label className="block mb-1">Shipping Address</label>
        <input
          name="address"
          value={formData.address}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
          placeholder="Street address"
        />

        <label className="block mb-1">City</label>
        <input
          name="city"
          value={formData.city}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">State/Province</label>
        <input
          name="state"
          value={formData.state}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Zip/Postal Code</label>
        <input
          name="zip"
          value={formData.zip}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Country</label>
        <input
          name="country"
          value={formData.country}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Date of Birth</label>
        <input
          name="dob"
          type="date"
          value={formData.dob}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        />

        <label className="block mb-1">Gender</label>
        <select
          name="gender"
          value={formData.gender}
          onChange={handleChange}
          className="w-full mb-3 p-2 border rounded"
        >
          <option value="">Select Gender</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>

        <div className="mb-4">
          <label className="inline-flex items-center">
            <input
              name="acceptedTerms"
              type="checkbox"
              checked={formData.acceptedTerms}
              onChange={handleChange}
              required
              className="mr-2"
            />
            I accept the <a href="/terms" className="text-blue-600 underline">Terms and Conditions</a>
          </label>
        </div>

        <button
          type="submit"
          className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700"
        >
          Signup
        </button>
      </form>
    </div>
  );
};

export default Signup;
